import {useParams, Route} from 'react-router-dom';
import {Fragment} from "react";

const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
        <h1>Quote Detail Page</h1>
            <p>{params.quoteId}</p>
            <Route path={`/quotes/$`}></Route>
        </Fragment>
    );
};

export default QuoteDetail;
